import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';
import { Container, TextField, Button, Grid } from '@mui/material';
import GoogleLogin from 'react-google-login';
import { gapi } from 'gapi-script';
import './LoginScreen.css';

const LoginScreen = () => {
  const history = useHistory();
  const [userLocation, setUserLocation] = useState(null);
  const [userData, setUserData] = useState(null);

  const clientId = '231057203284-vmjdr09plm6e9oc6l5stggfalf75reup.apps.googleusercontent.com';

  useEffect(() => {
    gapi.load('auth2', () => {
      gapi.auth2.init({ client_id: clientId });
    });

    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          setUserLocation({ latitude, longitude });
        },
        (error) => {
          console.error('Error getting location:', error);
        }
      );
    } else {
      console.error('Geolocation is not supported in this browser.');
    }
  }, [clientId]);

  const handleGoogleLoginSuccess = (response) => {
    const userData = {
      name: response.profileObj.name,
      email: response.profileObj.email,
      profilePicture: response.profileObj.imageUrl,
      location: userLocation,
    };

    setUserData(userData);

    history.push({
      pathname: '/LoginSuccess',
      state: { user: userData },
    });
  };

  const handleGoogleLoginFailure = (response) => {
    console.log(response);
  };

  const buttonStyle = {
    backgroundColor: 'rgb(215, 56, 55)',
    color: 'white',
    marginTop: '10px',
    padding: '10px 20px',
    borderRadius: '4px',
    fontWeight: 'bold',
    cursor: 'pointer',
    width: '100%',
  };

  return (
    <div>
      <div className="login-screen-content">
        <Container maxWidth="xs">
          <Grid container spacing={2} justifyContent="center" alignItems="center" className="login-form-container">
            <Grid item xs={12}>
              <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
                <h2 style={{ textAlign: 'center' }}>Login</h2>
                <TextField label="Email" variant="outlined" fullWidth />
                <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
                <Button variant="contained" color="secondary" fullWidth style={{ ...buttonStyle, marginTop: '20px' }}>
                  Login
                </Button>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '20px' }}>
                  <GoogleLogin
                    clientId="231057203284-vmjdr09plm6e9oc6l5stggfalf75reup.apps.googleusercontent.com"
                    onSuccess={handleGoogleLoginSuccess}
                    onFailure={handleGoogleLoginFailure}
                    buttonText="Google"
                  />
                </div>
              </div>
            </Grid>
          </Grid>
          {userData && userLocation && ( // Verifica se há dados de usuário e localização antes de exibir
            <Grid container spacing={2} justifyContent="center" alignItems="center" className="user-location-container">
              <Grid item xs={12}>
                <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
                  <h2 style={{ textAlign: 'center' }}>Dados do Usuário</h2>
                  <p>Nome: {userData.name}</p>
                  <p>Email: {userData.email}</p>
                  <p>Latitude: {userLocation.latitude}</p>
                  <p>Longitude: {userLocation.longitude}</p>
                </div>
              </Grid>
            </Grid>
          )}
        </Container>
      </div>
    </div>
  );
};

export default LoginScreen;
